{'message': '109K在150KM/H就能拉起来,相比190比较轻..加上轴炮缘故搞得降落的时候晃的有点心慌= =||还好MG151吊舱+MK108轴炮的后坐力刹车简直好评,不过109这个偏转的简直厉害各种担心撞出去还....滑跑距离的话虽然这桥其实还是蛮长的(我还特意挑了个长些的...还是各种感觉害怕滑出去什么的....虽然感觉这应该比那些单发的路航降航母还是简单多了的=_=

啊对了=w=本来进去是历史模式,忘记调成全真了不过问题也不大..反正操作一直是全面的噗~全程也是室内视角就别吐槽这个了恩

..以及..说好的解说还是没有..(捂脸.......麦还没买.......还是不会站渣浪而且...将就看下吧恩(=・ω・=)', 'plat': 0, 'device': ''}

